function fetchAndDisplayJSON(){fetch("https://raw.githubusercontent.com/starkware-libs/starknet-specs/master/api/starknet_api_openrpc.json?token=ASNPSF625O5JPOCD2SYH5D3BO3AAM&uiSchema%5BappBar%5D%5Bui:input%5D=false&uiSchema%5BappBar%5D%5Bui:darkMode%5D=true&uiSchema%5BappBar%5D%5Bui:examplesDropdown%5D=false").then(e=>{if(!e.ok)throw new Error("Error fetching JSON: "+e.status);return e.json()}).then(e=>{e=JSON.stringify(e,null,2);document.getElementById("jsonContainer").innerHTML=e}).catch(e=>{console.error(e)})}document.addEventListener("DOMContentLoaded",fetchAndDisplayJSON);